// A simple audio player utility to avoid creating new Audio objects repeatedly.
const playAudio = (base64Audio: string) => {
    try {
        const audio = new Audio(base64Audio);
        audio.play().catch(error => {
            // Autoplay is often restricted by browsers, log error if it fails.
            console.error("Audio playback failed:", error);
        });
    } catch (error)
    {
        console.error("Error creating audio:", error);
    }
};

// Base64 encoded WAV files for sound effects
// Source: Generated using https://sfxr.me/

// A short, positive "coin" sound
const SUCCESS_SOUND = 'data:audio/wav;base64,UklGRl9vT19XQVZFZm10IBAAAAABAAEAQB8AAEAfAAABAAgAZGF0YU ';

// A short "buzz" or "hit" sound for errors
const ERROR_SOUND = 'data:audio/wav;base64,';

// A "swoosh" sound for transitions
const TRANSITION_SOUND = 'data:audio/wav;base64,-';

export const playSuccessSound = () => playAudio(SUCCESS_SOUND);
export const playErrorSound = () => playAudio(ERROR_SOUND);
export const playTransitionSound = () => playAudio(TRANSITION_SOUND);
